import Vue from 'vue'
import App from './App.vue'
import router from './router'
import Router from 'vue-router'

Vue.config.productionTip = false

// 添加路由导航日志
router.afterEach((to, from) => {
  console.log(`Navigated from ${from.path} to ${to.path}`);
});

new Vue({
  router,
  render: h => h(App),
}).$mount('#app')
